INSERT INTO `comment` VALUES (65538,4,'vaya por delante que escribo el pick antes del Marsella-Athletic, dicho lo cual, vamos el porque el x2, si hay un equipo muy solido a dia de hoy es el de Asier Garitano que para ser el presupuesto mas pequeno de primera esta completando un ano espectacular y ya juega estos partidos sin la tension de tener que ganar ya que practicamente ganando 2 partidos hasta final de liga estaria salvado practicamente, El Athletic esta temporada unicamente tiene como objetivo llegar lejos en Europa, este partido le coincide con lo que se preeve una eliminatoria dura contra el Marsella y si puedieran desde el Athletic no lo jugarian , entiendo que en Ziganda rotara para este encuentro, el Athletic solo ha ganado 4 partidos de 13 como local y es uno peores locales de la competicion, El Lega ha tenido toda la semana para preparar el choque con lo que llegaran mas frescos, al Lega se le da muy bien el athletic con el que nunca ha perdido, 22.10.17 LL Leganes Athletic Club 1 : 0 14.05.17 LL Athletic Club Leganes 1 : 1 14.01.17 LL Leganes Athletic Club 0 : 0 resumiendo, que los leones van a estar a otra cosa (por la Europa League) llegan cansados al duelo y el Leganes que es un equipo serio y ordenado les rasca algun punto, muy buena cuota el x2',131183,65537),(65540,4,'Partido muy igualado en San Mames en el que se enfrentaran dos equipos muy rocosos. El Athletic en casa produce una gran cantidad de corners a favor debido a su juego directo y numerosos centros en busca de sus rematadores principales como son Aduriz y Raul Garcia, que ya sabemos que tienen un poderio aereo considerable. Por lo tanto veo la cuota de +5\'5 corners del Bilbao muy probable, mucha suerte!!',131184,65539),(65542,4,'Bueno vuelvo a probar a un equipo que en casa y mas ahora,de cara al la final que tienen el jueves dia 15, para intentar remontar el 3-1 del velodron,ante el Marsella, y deberan intentar ganar a un Leganes que esta haciendo una gran campana, el Athletic en casa ronda los 45 corners a favor recibiendo mas o menos los mismos el Leganes ,realiza fuera de Butarque sobre los 4, y recibe casi 6, por su manera de juego de intentar aprovechar los gallos en los ataques rivales o balones parados mal ejecutados, y saben salir tocada y rapidamente,nos vendrian incluso bien que el Leganes hiciera gol primero y si es gol tempranero mejor ,para asi que los leones se hechen encima del area de \"Pichu\" Cuellar. El partido practicamente se juegan mas los vascos tambien hay que ver en que plan salen por que como sea la tonica habitual, los madrilenos les endosaran 2 3 goles ,y me llamaran loco pero ,no seria raro. Espero que suceda asi con ese gol del Lega tempranero, y que reaccionen, si sucede al contrario pues ,sera mas de lo mismo por que si el Ath. Club hiciera gol antes ,no iran a por mas , como suele suceder y el Leganes se haria con el control y espero lleguen sus ocasiones, y esto se traduzca en saques de esquina. Buenas noches saludos suerte y a por el verde.',131185,65541),(65544,4,'Stake 1 para el partido que cerrara la jornada dominguera en espana. Se enfrentan en la nueva catedral el Athletic y el LEganes. Partido que espero muy renido y con pocos goles. Eso si, no creo que falten los corners. El ATH es un equipo que cuenta con Inaki Williams, Raul Garcia, Susaeta, Aduriz o Benat. Jugadores que merodean mucho el area rival y son propensos a sacar corners por sus centros o remates. El Lega por su parte es un equipo que lejos de Butarque promedia mas de 3,5 corners y pienso que nos puede echar una mano en esta apuesta. Suerte!',131186,65543),(65546,4,'El pronostico es que el Leganes sera el equipo mas amonestado. Veamos por que. En los trece partidos de liga que ha disputado en San Mames, el Athletic de Bilbao ha visto un total de veintiocho tarjetas amarillas y ninguna roja. Solo hay cuatro equipos mas limpios en sus estadios: Sevilla (27 tarjetas), Leganes (26), Real Madrid (22) y Barcelona (18). Por su parte, los equipos que visitan San Mames han visto un total de cuarenta y cuatro cartulinas amarillas y tres rojas. Solo hay un estadio en el que se han mostrado mas tarjetas (53) a los visitantes, Cornella-El Prat. Los numeros globales de San Mames apuntan a que lo mas probable es que el mas amonestado sea el equipo visitante. Desglosemos esos numeros partido a partido: En Liga, el Athletic fue el equipo mas amonestado en dos partidos, las visitas de Sevilla y Real Sociedad. En otros dos, visitas de Las Palmas y Eibar, hubo empate en numero de tarjetas. Y en los diez partidos restantes los colegiados mostraron mas cartulinas a los equipos visitantes. Nuestro pronostico se cumple en un 69% de las ocasiones (9/13). Si anadimos el partido de Copa, en el que tambien se cumplio, el porcentaje sube dos puntos, hasta el 71% (10/14). El Leganes es un equipo de dos caras. Como ya he dicho, en casa es el tercer equipo menos amonestado, y Butarque es el tercer estadio en el que se practica un juego mas limpio. Pero cuando salen de visita, los angelitos de Garicano se transforman y el equipo se convierte, junto con el Getafe, en el visitante mas amonestado de la liga, con cincuenta y dos tarjetas amarillas y una roja. Por contra, los equipos locales que han recibido al Leganes han visto un total de treinta y siete cartulinas, tres de ellas rojas. Los numeros globales de los desplazamientos del Leganes tambien apuntan a que sera este el equipo mas amonestado. Por partidos, las tarjetas se distribuyen asi: En Liga, el Leganes fue el equipo menos amonestado solo en dos visitas, a la Rosaleda y Mendizorroza. En otras tres salidas hubo empate a tarjetas, y en los nueve partidos restantes vio un mayor numero de cartulinas. Nuestro pronostico se cumple en un 64% de las ocasiones (9/14). Si anadimos los desplazamientos de Copa, en los que siempre se cumplio el pronostico, el porcentaje sube hasta el 76% (13/17). El colegiado de la contienda sera el murciano Jose Maria Sanchez Martinez. En los catorce partidos de liga que ha dirigido lleva mostradas un total de sesenta y seis tarjetas amarillas y tres rojas. Su promedio, 4\'93 tarjetas por partido, esta algo por debajo de la media general de la liga (5\'31) y le situa en el decimotercer puesto en la clasificacion de amonestadores. No subo sus numeros partido a partido porque son irrelevantes para este pronostico. No ha arbitrado aun en San Mames esta temporada, ni tampoco al Leganes como visitante. Pero si ha arbitrado en Butarque dos partidos de Copa (la visita del Villarreal, que vio una tarjeta por dos de los locales, y la visita del Real Madrid, en la que las tres tarjetas que se mostraron fueron para los pepineros) y tambien al Athletic en su visita a Eibar (cuatro tarjetas para los armeros y una sola para los leones). Todos esos partidos cumplieron con nuestro pronostico. Hay un detalle que no por -posiblemente- intrascendente quiero dejar de mencionar, y es que Sanchez Martinez es de momento el segundo arbitro menos casero de la temporada. Ha mostrado treinta y ocho tarjetas (tres de ellas rojas) a los locales por treinta y una a los visitantes. Solo Jose Luis Gonzalez Gonzalez se ha mostrado mas severo con los equipos anfitriones: cuarenta y seis tarjetas (una de ellas roja) para los locales y treinta y tres (entre ellas dos rojas) para los visitantes. Del Cerro Grande y Gonzalez Fuertes completan la lista de arbitros que, en conjunto, han castigado mas a locales que a visitantes. Los dieciseis colegiados restantes tienden a lo contrario. Otra circunstancia que podria hacer peligrar el pronostico es que algunos jugadores apercibidos del Athletic como Saborit o Iturraspe decidan provocar la tarjeta para borrarse del partido siguiente en el Camp Nou. Sin embargo, bien podria ese mismo peligro jugar a nuestro favor si jugadores del Leganes como Eraso o Diego Rico buscasen deliberadamente ser amonestados para cumplir ciclo en la jornada siguiente, en la que reciben al Sevilla. A destacar, por ultimo, que en el enfrentamiento entre ambos equipos la temporada pasada en San Mames se mostraron nueve tarjetas amarillas, dos para el Athletic y siete para el Leganes. Dirigio el encuentro David Fernandez Borbalan. La cuota no es para tirar cohetes, senal de que la probabilidad de acierto es elevada. Por ello propongo un stake de 2\'5, entre arriesgada y probable. Un saludo a todos y mucha suerte en vuestros pronosticos.',131187,65545),(65548,4,'El tramite del partido pinta para ser luchado y aspero desde el primer tiempo, ya que los dos equipos son intensos y combativos por naturaleza. Sin embargo, si consideramos el factor campo del nuevo San Mames, creemos que Athletic Bilbao puede aprovechar alguna jugada puntual para ganar y sumar 3 puntos importantes desde el aspecto animico. su objetivo en la temporada es cerrarla de manera digna. Necesita ser mas efectivo al sumar solo 1 triunfo en sus ultimos 9 juegos ligueros. Al final, recuerda que Leganes puede terminar pagando su falta de jerarquia como visitante y perder el juego por algun error fatal. Considerando estos datos, los “Leones” pueden ganar 1-0, 2-0 o 2-1 tras el pitazo final. Mi pronostico para Athletic Bilbao vs Leganes: Athletic Bilbao gana el partido',131188,65547),(65550,4,'Hola buenos dias. Vamos con el partido que cierra la jornada en nuestra liga. Voy con este pick porque viendo las estadisticas de ambos equipos invita a que va a pasar bien poco hoy. San Mames es el campo donde menos goles se anotan esta temporada en liga y el Athletic seguro que con la cabeza puesta en el partido del jueves acabe reservando a gente como Aduriz, Raul Garcia, benat...gente importante. Por otro lado esta el Leganes, en tierra de nadie, un conjunto rocoso que arriba le cuesta hacer goles asi que lo veo muy factible. Suerte al que lo siga.',131189,65549),(65552,4,'Ambos equipos estan separados por solo un punto en la tabla de posiciones, aunque el Leganes ha tenido mejores resultados en los ultimos duelos entre si. En tres partidos de LaLiga entre ambos, el Athletic de Bilbao no ha sido capaz de vencer al Leganes y si analizamos el contexto en el que llegan ambos equipos, esa racha se podria extender este domingo. Mientras el Leganes tuvo toda la semana para preparar su viaje a Bilbao, los \'Leones\' han tenido un calendario exigente en las ultimas semanas y tuvieron que jugar en Francia este jueves, donde perdieron por 1-3 ante el Olympique de Marsella en los octavos de final de la Europa League. El triunfo de la semana pasada ante el Malaga fue un gran resultado para el Leganes, puesto que estaban sumidos en una racha de seis partidos sin victorias. Ahora estaran ad portas de un desafio mucho mayor ya que tendran que hacer algo que no logran desde mediados de octubre: ganar fuera de casa. El Athletic siempre es un equipo complicado en condicion de local y en esos casos no importa mucho como lleguen a este partido. Cabe destacar que el conjunto vasco no sabe de derrotas en sus ultimos ocho partidos como local, puesto que suman dos triunfos y seis empates despues de la derrota que sufrieron por 2-0 ante el Barcelona. Partido en definitiva que se prevee igualado y que se decantara en algun detalle puntual o algun error y ahi veo al Leganes mas fuerte pues esta acostumbrado a pelear durante todo el partido y no relajarse ni 1 segundo pues saben de sus carencias y las suplen con intensidad y pelea durante los 90 minutos. El Athletic tambien tiene el handicap negativo del cansancio del partido ante el Marsella y vuelve a tener que enfrentarse a los franceses la proxima semana. Suerte...',131190,65551),(65554,4,'Partido de primera division entre Athletic de Bilbao y Leganes. Mi pronostico es que el Athletic marca y saca al menos 5 corners. Partido en el que a priori debiera haber pocos goles. El Athletic marca y recibe pocos goles en casa, y al Leganes le cuesta mucho hacer gol. Creo que el Athletic hara gol, porque necesita, sale favorito y San Mames es un campo dificil. En cuanto a los corners, creo que si al Athletic se le pone cuesta arriba el partido, el pronostico saldra. Tendra que ir a por todas y cuando el Athletic juega asi saca corners. El problema es si se adelanta en el marcador. Para empezar el Leganes es un equipo rocoso, y en teoria no sera facil al Athletic marcar el primer gol. Si miramos el partido mas desfavorable para nuestra apuesta, es el del dia del Alaves. El Athletic se impuso 2-0 y se adelanto ya en el minuto 8, y a pesar de ello saco 4 corners. Seria rojo,pero el partido desde el minuto 8 cambio. Con un Leganes aguantando el 0-0 unos minutos y contando que el Athletic tarde o temprano hara gol, vamos con ella. Suerte.',131191,65553),(65556,4,'Cuoton!!! Las Palmas se juega la vida y viene de perder en Balaidos de la forma mas dolorosa posible, con remontada y gol en el ultimo minuto! No jugaron tan mal pero Chichi estuvo cagon! Estan los canarios a 3 puntos de salir del descenso en el que llevan toda la temporada y el rival aunque no sea el mas propicio, no es un equipo top ni el Villareal de otras temporadas, sobre todo en construccion ofensiva! Yo creo que en lo que queda de temporada vamos a ver resultados algo \"extranos\" y en este partido iria al sin de los canarios pero por precaucion y por la defensa del Villareal y su porterazo Asenjo mejor ir al 1X...y asi pasamos menos miedo! Por ultimo decir que el arbitro tendra maxima presion para que no vuelen puntos de alli con una aficion pudo pio que sabiendo lo que se juegan llenara el estadio, digo yo...suerte y verdazo! Stake 2\'5 hacia 3',131192,65555),(65558,4,'Ahora las palmas si sabe a que juega es un equipo trabajado y serio que viene de hacerle un dificil partido a un celta en su campo que perdio en los ultimos 10 minutos que jugara contra un Villareal en muy mala racha que no consiguio marcarle a un Girona jugando como local.Viendo esa solidez en su juego a Las Palmas la confianza que muestran sus jugadores en su campo el empate que lograron contra el Barcelona hace 2 jornadas me decanto por el 1x a favor del equipo canario',131193,65557),(65560,4,'Buenas a todos despues de tiempo pensandolo me he decidido a poner mis propios picks y a ver que tal va la cosa Respecto al partido, son dos equipos muy necesitados de puntos y van a ir ambos a por la victoria, aunque las estadisticas con estos dos equipos no nos acompanan y tampoco me gustan mucho para analizar ya que cada partido es diferente. Las Palmas como sabemos esta al borde del abismo y tiene que ganar si o si, en funcion de como este el partido va a arriesgar mas de la cuenta y ya sabemos como son los equipos de jemez y por parte del villarreal viene de una mala racha, jugando muy mal al futbol y este partido debe ser la reveindicacion de la plantilla y del tecnico, tiene un centro del campo brutal pero para mi gusto mal gestionado por Calleja, se la juega en este partido y dada la necesidad de puntuar y ganar de ambos equipos me he decidido por el over +2,5 Stake bajito por lo que pueda pasar Saludos!',131194,65559),(65562,4,'A pesar de la derrota en Vigo en el ultimo instante el pasado lunes, el Las Palmas me dio una buena sensacion en el choque anterior frente al Barca. El equipo va mejorando en su nivel y recibe a un irregular Villarreal, que no ha sido capaz de marcar mas de un gol en ninguno de sus ultimos ocho encuentros. En los dos ultimos contra el Eibar y el Girona se quedo sin ver puerta. Su crisis de juego es evidente, y ya tiene imposible entrar en la Champions League.',131195,65561),(65564,4,'Vamos a ir con el partido entre las palmas y el villareal en el que buscamos que el villareal anote al menos 4 corner. Las palmas: Antepenultimo clasificado con 20 puntos a 1 de la salvacion. Ultimos 5 encuentros 3 empates y 2 derrotas Viene de caer frente al celta 2-1 Villareal: Ocupa la 6 plaza con 41 puntos actualmente en europa league. Ultimos 5 encuentros 3 derrotas 1 empate y 1 victoria Acumula 2 derrotas consecutivas Viene de caer contra el Girona 0-2 Vamos con los corner: Las palmas encaja una media de 5.5 Villareal promedia 4.8 a favor como vemos con estos datos ambos por encima de la linea marcada. Las palmas a encajado al menos 4 corner en 19/27 70% Villareal a sacado al menos 4 corner en 19/27 70 % La combinada nos da un 70% Espero un encuentro muy disputado en el que las palmas jugando en casa y jugandose el descenso apriete mucho incluso se puede adelantar en el marcador lo que provocaria mas corner del villareal, que necesita volver a ganar partidos si quiere seguir en europa. Suerte!',131196,65563),(65566,4,'Clasica apuesta que veo en linea +5,5 y me gusta mucho, necesitaremos que Las Palmas saque mas de 5,5 corners en casa ante el Villarreal y los veo. Creo que Las Palmas sacara mas de 5,5 corners porque juegan en casa y les cuesta mucho marcar gol, se sacrifican en defensa por lo que consiguen pocos goles, ese estilo que ha implantado Paco Jemez creo que le valdra para conseguir la permanencia. Mi idea es que Las Palmas juegue con mucha intensidad, domine la pelota y al llegar a 3/4 sufran la falta de creatividad para llegar a la meta del villarreal, de ahi creo que conseguiran muchos corners, confio en Asenjo que esta en un momento dulce para mandar todo lo que vaya gol a corner, espero una ayuda de la defensa del villareal, destaco que las palmas con jemez esta aprovechando mucho las bandas y no pierden oportunidad de forzar el corner cuando estan en la esquina, por eso han conseguido bastante corners ultimamente, y los del Villarreal no son los mejores despejando la pelota, por lo que en varias ocasiones acaban cediendo corners en contra.',131197,65565),(65568,4,'Las Palmas en casa en sus ultimos 5 partidos ha cumplido este pronostico en 4 de ellos: Las Palmas Barcelona 1-1 Las Palmas Sevilla. 1-2 Las Palmas Valencia 2-1 Las Palmas Eibar 1-3 Equipos del nivel del Villareal El Villareal en sus ultimos 5 partidos fuera de casa ha metido gol solo en 2( no cuento el 3-1 contra el Lyon) Uno por no descender y el otro por entrar en puestos europeos, intuyo partido con goles de ambos equipos.Suerte a quien siga el pick',131198,65567),(65570,4,'Vamos con esta apuesta de Handicap de corners, que ganeremos si Las Palmas obtienen al menos 2 corners mas que el Villareal. ESTADISTICAS ------------------- - MEDIAS Las Palmas (en casa) promedia 6 corners a favor, y 3.9 en contra (+2.1) Villareal (fuera) promedia 3,9 corners a favor y 7.1 en contra (-3.2) - MEDIANAS Las Palmas (en casa) ha ganado por 2 corners o mas 7/13 partidos (54%) Villareal (fuera) ha perdido por 2 corners o mas 9/14 partidos (64%) Asi que entre ambos tendriamos 16/27, un 59.3%, equivalente a una cuota de 1.69 (nuestra cuota es 1,93). ANALISIS -------------- Tenemos a unas Palmas que a pesar de su mala posicion en la tabla, durante esta temporada se han mostrado bastante over en cuanto a corners. Con la llegada de Jemez el equipo parece que esta atacando mas (tuvo un 55% de posesion contra el Sevilla por ejemplo, o un 57% en Leganes), aunque sigue con muchisimos problemas para hacer gol. Pero esto para los corners no es algo precisamente malo. El Villareal por su parte es un equipo muy under en cuanto a corners (yo diria que lo es historicamente, aunque lo digo por impresion y sin datos..), y ademas como hemos podido ver en las estadisticas es un equipo que concede bastante. Ademas parecen equipos en dinamicas contrapuestas. Las Palmas no sale del pozo pero parece que esta a puntito, y Villareal languidece desde su eliminacion en la EL. Si contaramos solo los ultimos 8 partidos: Villareal seria 12º en la clasificacion liguera, y LasPalmas 14º Stake 0,5 porque en tema de corners la variabilidad y las \"sorpresas\" son aun mayores que en goles, y absolutamente todo puede pasar Saludos.',131199,65569),(65572,4,'Vamos con este pick corresopndiente a la jornada de la liga espanola de primera division y que enfrenta a Las Palmas contra el Villarreal. Cierto que las palmas con paquito ha mejorado bastante, son mas aguerridos y saben a lo que juegan, a presionar al rival en campo contrario e intentar robar la pelota para montar la contra aunque eso haga que se descuide atras. Y aqui vamos a entrar con el villarreal, con un delantero como bacca hara destrozos en la defensa a la contra y es que Las palmas despues de haber ganado el levante tendra que salir a por todas, no le queda otra mientras que el villarreal esperara su oportunidad a la contra para machacar. suerte a quien la siga',131200,65571),(65574,4,'Dos equipos que potencialmente destacan mucho en este aspecto ya que suelen sacar muchos corners. Son equipos a los que les gusta jugar y con un juego muy dinamico. Hoy con lo que sacaran creo que se generaran muchos corners. Castillejo y Fornals son jugadores que muchas veces pegados a la linea de cal y teniendo un delantero como Bacca que es un killer buscar el juego exterior sera prioritario. En las Palmas depende un poco de como plantee el partido Jemez. Halilovic y Tana puede ser que se tiren hacia el medio para coger balon lo que no es bueno para nuestro pronostico. Aun asi, uno por Europa, el otro por el descenso. Necesitan hacer un buen papel asi que creo que puede entrar. Veremos a ver....',131201,65573),(65576,4,'Partido de primera division entre Las Palmas y Villarreal. Mi pronostico es que mete gol Las Palmas antes del minuto 60. Voy a probar esta apuesta, es una apuesta arriesgada pero probable. El Villarreal no esta en buen momento de forma, puede perder este partido perfectamente y tranquilamente encajar goles.Vemos que Las Palmas ha marcado con Jemez gol en casa en todos los partidos, y frente a equipos de entidad como Eibar, Sevilla, Bacelona, Valencia...eso si, en unos antes del minuto 60 y otros despues. Aprovechando el momento de dudas del Villarreal y que Las Palmas ultimamente de local mete en todos los partidos,esperemos que meta gol el equipo local antes del 60. Suerte.',131202,65575),(65578,4,'Partido de primera division espanola entre Las Palmas y Villarreal. Mi pronostico es que no empatan y hay menos de 3,5 goles. En cuanto a empatar son dos de los equipos que menos empatan de la liga. En 27 partidos , ambos han empatado 5 partidos, 2 en casa Las Palmas y 3 fuera Villarreal. Los empates de Las Palmas frente a Espanyol y Barca, el Espanyol empata mucho. Y Villarreal frente Espanyol, Athletic y Atletico, los 3 empatan con frecuencia,Atletico menos, pero cuando no gana es dificil que pierda. Y en cuanto a goles, en los partidos del Villarreal fuera no se suelen ver muchos goles. Han superado la linea de 3,5 solo en 2 ocasiones fuera del Madrigal.Veo dificil que cualquiera de los 2 equipos supere los 2 goles. Suerte.',131203,65577),(65580,4,'Vamos a probar el under 2,5 goles, el Villarreal llevara la batuta del partido y Las palmas estara bien ordenado atras intentando aprovechar cualquier robo y a la contra y asi poder sacar un resultado positivo contra un rival dificil que le gusta mucho tener la posesion del balon. Para las palmas que esta hundido en la clasificacion sacar un punto contra el rival que les viene a visitar. Suerte en el pick! Ademas aprovecharemos la diferencia de cuota de bet365 comparado con otras bookings',131204,65579),(65582,4,'Confiamos en que el Villarreal siga en la lucha por entrar en Europa y no conceda nada contra un Las Palmas que tras la victoria del Levante esta casi descendido. Esperamos un partido abierto (Paco Jemez) en el que la velocidad de Bacca y Castillejpo haran el verde. El Villarreal saldra a por la victoria ante un rival muy flojo.',131205,65581),(65584,4,'Partido entre Las Palmas y el Villarreal Voy a que Las Palmas sacara 2 o mas corners en cada tiempo. Las Palmas se encuentra en la parte baja de la clasificacion, con 4 equipos hundidos en esos puestos, solo se puede salvar 1 y cada partido y mas en casa es una final y creo que eso hara que vayan con mas ahinco hacia la porteria rival en busca de la victoria. Ademas el Villarreal es un rival muy incomodo, que aunque este en una mala racha, es dificil hacerle gol, y creo que incluso se puede adelantar en el marcador lo cual facilitaria las cosas. Y creo que los datos son buenos 6 corners contra el barcelona 7 contra el sevilla 4 contra el malaga pero ganaron 1-0 Y fuera de casa sacaron 7 contra el celta y 5 contra el leganes, como vemos con Paco Jemez son muy asiduos a la esquina Jugando en casa 2 corners en cada parte creo que es factible, no es gran cuota pero creo que merece la pena.',131206,65583),(65586,4,'Partido de la Liga Santander que se disputa en la tarde de hoy domingo y enfrenta en un interesante partido a Atletico de Madrid y Celta de Vigo en el espectacular Wanda Metropolitano. Pronostico para este partido que ambos equipos obtendra como minimo 3 corners y es que me parecen pocos teniendo en cuenta el nivel ofensivo que tienen ambos conjuntos y la cuota superior a la que me podia esperar. Que el equipo colchonero va a tener 3 corners parece mas que seguro, juega en casa, pasa por un gran momento, y no hay dudas de que ira a por el partido desde el minuto 1, el unico condicionante para el pronostico es que el Celta lo consiga, que tambien lo creo, los de Unzue son un equipo que no se limitan a esperar al rival, jueguen en el campo que jueguen no son intimidados y seguro que saldran a hacer un gran partido y a por los puntos, ademas en el caso de que el Atletico de Madrid se ponga por delante en el marcador no hay dudas de que el Celta ira a por todas a buscar la porteria contraria. Casas de apuestas que ofrecen la cuota de que el Celta obtendra 3 corners o mas la dan por cuota de 1,42 y en nuestro pronostico anadiendolo a los corners del Atletico de Madrid estamos hablando de una cuota de 1,75 por lo que el valor que tiene es evidente. Todos los numeros estadisticos hablan a nuestro favor y todos nos hacen pensar de que tendremos el pronostico pintado de verde: Atletico Madrid corners a favor por partido: 4,07. Celta corners a favor por partido: 3,93 Atletico Madrid corners en contra por partido: 4. Celta corners en contra por partido: 4,89. Los numeros hablan por si solos, tanto Celta como Atletico de Madrid obtienen mas de 3 corners por partido a favor, y conceden por partido a sus rivales mas de 3 corners en contra, asi que si ambos siguen con la media que tienen tras 27 jornadas veremos 3 o mas corners por ambos equipos. El Celta de Vigo de sus ultimos 8 partidos, en 7 de ellos ha obtenido 3 o mas corners: - Real Sociedad-Celta 1-2: Celta 3 corners (verde). - Celta-Betis 3-2: Celta 7 corners (verde). - Alaves-Celta 2-1: Celta 1 corner (rojo). - Celta-Espanyol 2-2: Celta 9 corners (verde). - Getafe-Espanyol 3-0: Celta 5 corners (verde). - Celta-Eibar 2-0: Celta 3 corners (verde). - Girona-Celta 1-0: Celta 4 corners (verde). - Celta-Las Palmas 2-1: Celta 10 corners (verde). A confiar en un partido con corners por ambos bandos, suerte a todo quien me siga que sera asi mi suerte.',131207,65585),(65588,4,'Nos vamos al Wanda Metropolitano en donde va a tener lugar el encuentro entre Atletico de Madrid y Celta de Vigo, perteneciente a la vigesimo-octava jornada de la Liga BBVA. El conjunto rojiblanco llega como segundo en la tabla, a 11 del F.C. Barcelona con un partido menos, y los gallegos son novenos. El Atletico de Madrid ha conseguido 61 puntos en 27 jornadas, datos bastante buenos pero que no suficientes para estar cerca del lider, el F.C. Barcelona. En Liga vienen de perder en el Camp Nou por 1 a 0, en un encuentro en donde los madrilenos pudieron hacer bastante mas. Desde mi punto de vista, el planteamiento inicial del Cholo fue realmente malo y salieron a esperar a los de Valverde, lo que les acabo castigando con el unico tanto del partido. En la segunda mitad se vio una cara bastante mejorada del Atleti y fueron a remontar el partido, pero les fue imposible. En Europa League dieron una imagen bastante mas solida ante el Lokomotiv de Moscu y consiguieron un casi definitivo 3 a 0. Los rusos no tiraron a puerta con peligro y las llegadas fueron contadas. Control absoluto del partido por parte de los del Cholo Simeone, que se estan sintiendo cada vez mas comodos en su estadio. Esta semana, en Europa League, ya fui con la goleada del Atletico de Madrid porque estan jugando cada vez mejor en el Wanda, se estan sintiendo bastante comodos en la creacion del juego ofensivo y estan muy resolutivos de cara a puerta. El objetivo de los rojiblancos es asegurar los puestos de Champions y luchar, hasta que les deje el Barca, por el titulo liguero. Parece que Oblak no va a tener ningun problema en disputar este encuentro, totalmente recuperado de sus molestias, y la posible alineacion es la siguiente: Oblak; Vrsaljko, Gimenez, Godin y Lucas; Koke, Gabi, Saul y Vitolo; Costa y Gameiro. Segun comentan algunos medios, podria darse la posibilidad de que Costa entrara dentro de las rotaciones, pero me parece bastante improbable que esto suceda. El partido del jueves, ante el Lokomotiv, me parece bastante mas propicio para hacer rotaciones, teniendo al Villarreal en el siguiente fin de semana. Los ultimos resultados del Atletico de Madrid en el Wanda Metropolitano son los siguientes: 08.03.18 EL Atletico de Madrid Lokomotiv Moscu 3 : 0 28.02.18 LL Atletico de Madrid Leganes 4 : 0 22.02.18 EL Atletico de Madrid Copenhague 1 : 0 18.02.18 LL Atletico de Madrid Athletic Club 2 : 0 04.02.18 LL Atletico de Madrid Valencia 1 : 0 28.01.18 LL Atletico de Madrid Las Palmas 3 : 0 El partido ante el Copenhague fue un mero tramite y donde creo que surgio el cambio real de cara a puerta fue ante el Athletic Club, en la segunda mitad del encuentro. A partir de ahi, todos sus partidos han estado plagados de ocasiones y con un dominio casi completo del partido. El estilo del Celta de Vigo es propicio para que el Atletico de Madrid gane el partido con solvencia, sobre todo ante la incapacidad defensiva de los gallegos en la presente temporada. El Celta de Vigo lleva 38 puntos en 27 jornadas y han encajado 39 tantos, mostrando una gran debilidad defensiva, sobre todo a balon parado. En sus partidos como visitantes han perdido 8 de los 14 partidos, dato bastante negativo para el club dirigido por Unzue. La aficion esta bastante descontenta con el juego del equipo y, realmente, no he visto que el Celta sea una plantilla unida y con un estilo de juego definido. El objetivo es llegar a la septima plaza, que va a dar acceso a la Europa League la proxima temporada. Esta septima plaza la ostenta el Villarreal con 41 puntos, 3 puntos mas que el Celta, y los mismos partidos disputados que el club vigues. Veo bastante dificil que el Celta consiga llegar a Europa este ano, lo que va a suponer un gran fracaso del proyecto de Unzue. Como visitantes llevan 3 derrotas consecutivas: 27.02.18 LL Girona Celta de Vigo 1 : 0 19.02.18 LL Getafe Celta de Vigo 3 : 0 03.02.18 LL Alaves Celta de Vigo 2 : 1 La imagen dada ante el Getafe fue bastante mala y el estilo de juego del Atletico de Madrid le hace bastante dano a este tipo de equipo. Koke ha vuelto a tener un buen nivel y sus pases a la espalda de la defensa estan haciendo mucho dano. Luego, a balon parado es otro aspecto del juego en el que los rojiblancos son bastante superiores al Celta. Diego Costa esta de dulce con el gol y Vitolo va a querer aprovechar los minutos para demostrar que tiene sitio en el once inicial de aqui al final de la temporada. Con todo esto creo que el Atletico de Madrid va a ganar por una ventaja de 2 o mas goles.',131208,65587),(65590,4,'Lo veo en la linea de peligro, pero el Atletico lucha por el 2do puesto y el Celta por ultimar sus oportunidades UEFA osea que motivos para que haya intensidad y lucha no faltaran! No creo que saber el arbitro sea condicionante ni relevante que es el argumento que utilizan muchos para condicionar un over o under de tarjetas! Cada partido es diferente y a los arbitros tarjeteros un dia les puede dar por no sacar...o viceversa...suerte',131209,65589),(65592,4,'Vamos con este pronostico para el encuentro donde se enfrentaran Atleti y Celta de Vigo en el Wanda Metropolitano. El pronostico es: 1-4 goles, 1-5 tarjetas y 6-14 Corners. Veamos los motivos: - Esperamos un partido de control por parte colchonera, de ritmo bajo, ya que no le interesa un partido de transiciones, viniendo de disputar un gran encuentro ante el Lokomotiv hace 3 dias. Aunque ultimamente ha resuelto sus encuentros con alguna goleada, lo normal del atleti es afrontar el partido desde el control, la solidez defensiva y ha sacado multitud de ellos por 1-0. Es probable que el Cholo haga alguna rotacion, para dar descanso a sus titulares y con ello se igualen mas las fuerzas entre ambos equipos. Sus ultimos resultados han sido: ATL 3 - 0 LOK BAR 1 - 0 ATL ATL 4 - 0 LEG SEV 2 - 5 ATL ATL 1 - 0 KOB - Arbitrara Alberola rojas, un colegiado que lleva 3.64 tarjetas amarilla/partido de media, y que ha mostrado 3, 2, 3+1, 6, 3, 2, 4+1, 5. Con estos datos, tendriamos 7 verdes y 1 rojo en los ultimos encuentros de este arbitro. En los ultimos enfrentamientos entre ambos equipos se mostraron: 8, 3, 3, 9, 6, 1, 3, 4, 4, 4.. Es decir, tenemos resultados de todo tipo, under y overs en funcion de los partidos, de la tension que haya habido, del colegiado, etc. Confiamos en un encuentro de ritmo bajo donde no haya mucha \'guerra\' entre ambos. - 6-14 corners. Anadiremos el numero de corners de los ultimos encuentros entre ambos: 8, 6, 10, 8, 13, 6, 8.. Tenemos una horquilla de corners que cumplir muy asequible, ya que casi todos los encuentros tienen mas de 6 corners y es raro ver mas de 14 lanzamientos de esquina por partido. Esperemos que se cumplan los pronosticos y salga el verde. Suerte a quien la siga!!',131210,65591),(65594,4,'Vamos con un encuentro de primera entre el atletico y el celta en el wanda probaremos a que el atletico anota un par de goles. El atleti esta dr dulce sus ultimos 5 encuentros en el wanda los ha ganado ha anotado 11 goles y ha dejado su porteria a cero por su parte el celta 9° en mitad dr tabla sus ultimas tres salidas ha perdido contra girona,getafe y alaves. Pero vamos me guio en sus ultimas cinco visitas al campo del atleti. 3-2 2-0 2-3 2-2 2-1 Vemos que los atleticos en estos cinco encuentros saldria verde nuestro pickasi que con estos datos vamos con ello suerte',131211,65593),(65596,4,'Partido que se disputa hoy en poco mas de 1 hora en el Wanda Metropolitano. Se enfrentaran el Atletico de Madrid y el Celta. - Necesitamos que se muestren menos de 2 tarjetas en los primeros 45 minutos, como maximo una tarjeta por lo tanto. Pues llevo varios dias mirando a ver si bwin sacaba tarjetas pero a esta hora siguen sin sacar ningun mercado de cartulinas asi que seguire confiando el Alberola Rojas como colegiado como ya he hecho multiples ocasiones. Subire la cuota actual ya que el 1,85 duro poquisimo en william hill. Decir que la apuesta se puede hacer en betfair con algo mejor cuota que la que ofrece william hill. Para ello hay que apostar a que hay menos de 10 puntos por tarjetas en la primera parte a cuota 4,5 y tambien a que hay justamente 10 puntos por tarjetas a cuota 2,87. Para un importe de 20€ habria que meter 12,21€ a la cuota 2,87 y 7,79€ a la cuota 4,5. - La razon principal para ir con este pronostico es el arbitro de la contienda, el debutante esta temporada en primera division, Alberola Rojas. A la mayoria de los arbitros les gusta advertir antes de comenzar a sacar tarjetas en sus partidos y que de este modo que no se les vayan los partidos de las manos. Alberola es uno de los maximos exponentes en este tipo de arbitraje. - Alberola ya de primeras es un arbitro under, ahora mismo es el lider dentro de la clasificacion de colegiados que menos tarjetas han sacado de toda La Liga con un promedio de 4,3 tarjetas / partido (la gran mayoria en las segundas partes). Y es que ya ha arbitrado 14 partidos esta temporada en Liga y en 12 de ellos fue acertado este pronostico, incluso en partidos duros que acabaron con unas cuantas tarjetas casi siempre se cumplio un acierto para esta linea. Hay que decir que los 2 rojos son dentro de sus ultimos 3 partidos arbitrados pero creo que hoy es un buen partido para que vuelva a su dinamica de los primeros partidos. Veamos varios de estos partidos mas destacables: - En sus ultimos 5 partidos: Viene de un fallo en el Levante - Espanol que me dio mala espina, antes 0 tarjetas en la primera mitad del Barcelona-Girona y justo antes su otro fallo en el Betis - Villarreal donde 1 roja directa a Bonera sobre el minuto 35 enloquecio el final la primera parte. Justo antes saco 6 tarjetas en el Sevilla - Getafe (las 6 en la 2ª parte) y antes 3 tarjetas en el Deportivo - Valencia (las 3 en la 2ª parte). - Otros partidos de interes: Malaga - Betis, en el cual acabo el partido mostrando 4 amarillas y 1 roja directa pero solo 1 amarilla en la primera parte. En el Getafe - Eibar enseno 5 amarillas (todas en la segunda parte). El partido que mas tarjetas mostro fue el Villarreal - Sevilla donde se fue a 7 amarillas y 1 roja por doble amarilla pero solo 1 amarilla en la primera parte. - Por parte de los equipos. Tenemos 2 equipos no demasiado conflictivos en principio. Por parte atletica destacar que dentro de sus ultimos 5 partidos en el Wanda tenemos 3 aciertos para esta apuesta y estos 3 aciertos fueron con 0 cartulinas en el descanso. Estos 3 partidos fueron contra el Valencia, el Leganes y contra Las Palmas. Por lo tanto el Atletico no recibio ninguna tarjeta al descanso en estos 3 encuentros y en estos 5 partidos recibio tan solo 3 tarjetas antes del descanso. Por parte del Celta hay que destacar que dentro de sus ultimos 5 partidos jugados en condicion de visitante tenemos otros 3 aciertos para esta linea. Ademas vemos como el Celta se quedo a 0 tarjetas recibidas en la primera parte en 3 de estos 5 partidos en cuestion. En estos 5 partidos el Celta recibio un total de 3 tarjetas antes del descanso. Suerte.',131212,65595),(65598,4,'Partido disputado entre el 2 clasificado y 9 clasificado. El celta un equipo luchador, jugara encerrado atras y salir con Iago aspas. El atletico lo tendra complicado para traspasar esa barrera, pero pienso que finalmente entrara algun gol. Partido de pocos goles, por lo que tambien podriamos meterle a menos de de 2.5 goles y atletico pero nos decantamos por este pronostico. Mucha suerte a todos!!',131213,65597),(65600,4,'Buenas Vamos con el empate o victoria del betis frente al alaves de abelardo en mendizorroza. El equipo de abelardo ha tenido muy buenos numeros desde su llegada, llego siendo colista y lo ha situado a 11 puntos de un descenso que marca ahora mismo las palmas a la espera de lo que haga esta noche frente al celta. El alaves en su campo suele ser un equipo aguerrido y que presiona muy arriba con unos buenos numeros, donde tiene 4 victorias y 1 empate en los ultimos 5 partidos. si bien es cierto que se ha enfrentado a rivales debiles como levante o deportivo de la coruna, tambien con victorias de merito frente a sevilla todo hay que decirlo. Creo que el betis puede imponer su estilo de juego en mendizorroza si aguanta el chaparron inicial que imagino haran los de abelardo con su presion arriba impidiendo la salida de balon limpia del cuadro de quique setien. Para este partido recupera ya a jugadores muy importantes como guardado y podra contar con campbell tambien aunque esta fuera de forma. El betis tiene un centro del campo de mucha mas calidad con guardado, fabian boudebouz o javi garcia, mencion aparte a las bandas con joaquin que esta espectacular, si consigue con el paso de los minutos aplacar el embite de los de abelardo no me cabe duda de que pueden conseguir perfectamente la victoria con su juego de toque y su calidad arriba.',131214,65599),(65602,4,'A por la segunda X de toda la temporada del Alaves que ya es el equipo que menos empata de todo el pais y puede que de toda Europa! Esto ya no es normal y perdon que me ponga cabezon con las tablas pero es que en el ultimo partido volo el empate en el 91\' contra el.Levante! El punto sirve mas a los vitorianos que a los sevillanos y no creo que el Alaves encadene su 3er partido seguido o cuarto ya ganando en casa...no son el Barca ni el Madrid leches jaja! El Betis ira a por todas porque aun tiene opciones de Uefa y de pillar al Sevilla pero el Alaves necesita sumar el puntito o los 3 para sellar la permanencia ya...si fallo esto me retiro de la tipster league del mes! Suerte',131215,65601),(65604,4,'Bueno pues partiendo del empate, que es lo que creo que pasara, he descubierto en Codere este mercado interesante donde nos valen: 0-0,1-1 y 3-0,2-1,2-0,1-0 es decir practicamente todo lo \"logico\" siempre que no gane el Betis que ira a por todas porque no tiene nada que perder pero que enfrente tendra a uno de los equipos mas rocosos de ka categoria y que rara vez no hace gol! Con este pick busco blindar un poco mas el empate que es lo que creo sucedera! Saludos!',131216,65603),(65606,4,'El Alaves solo ha cosechado un marcador de \"goles par\" de sus ultimos 6 encuentros ligeros cuando recibio el 4-0 en Madrid y como pienso que el marcador par siempre es minimamente algo mas probable que el impar, dentro de la loteria que son estos mercados, tendriamos cubiertos todos los empates y la mitad de los resultados victoriosos para uno u otro equipo! Goles par en las casas 1\'80 e impar 1\'90, es decir que en esa \"loteria estadistica\" la posibilidad inicial no es a \"fifty-fifty\" y creo que voy a tener suerte sea cual sea el resultado que en otras publicaciones vereis que creo sera una X...el segundo empate vitoriano de la temporada y con ello un verde bien majo! Suerte al que la siga: empates con o sin goles+resultados: 2-0,0-2,3-1,1-3,4-0,0-4....todo eso nos vale! Vamos!',131217,65605),(65608,4,'Partido de primera division espanola entre Alaves y Real Betis. Mi pronostico es que no empatan y hay menos de 3,5 goles. Creo que puede pasar cualquier cosa en este partido. Se enfrentan 2 de los equipos que menos empatan. En 27 partidos el Alaves solo ha empatado 1 partido y el Real Betis 4. Como local 1 el Alaves y 1 el Betis como visitante. Creo que el que se adelante tiene muchas posibilidades de ganar. El Alaves defiende muy bien en casa y el Real Betis esta mejorando mucho en defensa. No espero mas de 3 goles. Suerte.',131218,65607),(65610,4,'Vamos con este duelo entre Alaves vs Betis,mi pronostico empate,apuesta no valida y gana Betis. El Alaves va 16° en la tabla a once puntos del descenso,no se juega mucho ya que no lo veo como para bajar,tiene 10v 1e 16d con 24 goles a favor y 39 en contra,marca poco y recibe muchos,solo empato una vez,solo tiene la duda de vigaray en cuanto a bajas. El Betis va decimo y de ganar se pondria a 3 puntos de la zona europea,tienen 11v 4e 12d con 43 goles a favor y 53 en contra.Marca casi el doble que su rival aunque tambien recibe bastantes,en cuanto a bajas Joaquin,Sanabria y Feddal. Preveo un partido muy disputado pero quiero aprovechar esta buena cuota y creo que el Betis tiene mejor equipo,juego y se juega sonar con europa. Empate,apuesta no valida y gana el Betis,suerte!!',131219,65609);
